mutation AddIntervention {
    addIntervention(intervention: {
        date: "2020-12-01",
        type: LIMIT_MOBILITY,
        parameters: [{
            id: "reduction",
            value: 50,
        }, {
            id: "min_age",
            value: 7,
        }, {
            id: "max_age",
            value: 12,
        }, {
            id: "place",
            choice: "school",
        }],
    }) {
        id
    }
}

query {
    validationMetrics {
        dates
        metrics {
            type
            intValues
            isSimulated
        }
    }
}

query {
    availableInterventions {
        id
        type
        description
        parameters {
            id
            description
            required
            ... on InterventionChoiceParameter {
                choices {
                    id
                    label
                }
            }
            ... on InterventionIntParameter {
                minValue
                maxValue
            }
        }
    }
}

query {
    activeInterventions {
        id
        type
        date
        parameters {
            id
            ... on InterventionIntParameter {
                value
            }
            ... on InterventionChoiceParameter {
                choice {
                    id
                    label
                }
            }
        }
    }
}

query getSimulationResults($runId: ID!) {
    simulationResults(runId: $runId) {
        finished
        predictedMetrics {
            dates
            metrics {
                type
                label
                intValues
                floatValues
            }
        }
    }
}
